import { NativeStackScreenProps } from "@react-navigation/native-stack";
import { Image, ScrollView, Text, View } from "react-native";
import { RecordStackParams } from "../../../navigation/types";
import Header from "../../../components/common/header";
import SelectButton from "../../../components/common/selectButton";
import { SafeAreaView } from "react-native-safe-area-context";
import { useEffect, useState } from "react";
import MapView, { Marker } from "react-native-maps";

interface RecordDetailScreenProps
  extends NativeStackScreenProps<RecordStackParams, "RecordDetail"> {}

export default function RecordDetailScreen({ route }: RecordDetailScreenProps) {
  const { title, fishId } = route.params;
  console.log("fishId:", fishId);

  // 임시 데이터
  const dataMap = [
    {
      fishId: 1,
      fishName: "붕어",
      place: "거제시 거제면",
      size: 32,
      fishImg:
        "data:image/jpeg;base64,",
      createAt: "2025-06-18T14:30",
      season: 5,
      lat: 34.8801,
      lng: 128.6212,
      bait: "지렁이",
      method: "낚싯대",
    },
    {
      fishId: 2,
      fishName: "잉어",
      place: "거제시 거제면",
      size: 45,
      fishImg:
        "data:image/jpeg;base64,",
      createAt: "2025-06-18T16:10",
      season: 6,
      lat: 34.8803,
      lng: 128.6215,
      bait: "새우",
      method: "낚싯대",
    },
    {
      fishId: 3,
      fishName: "배스",
      place: "거제시 거제면",
      size: 28,
      fishImg:
        "data:image/jpeg;base64,",
      createAt: "2025-06-18T18:00",
      season: 7,
      lat: 34.8805,
      lng: 128.622,
      bait: "루어",
      method: "루어",
    },
    {
      fishId: 4,
      fishName: "장어",
      place: "제주시 용담2동",
      size: 60,
      fishImg:
        "data:image/jpeg;base64,",
      createAt: "2025-06-10T11:50",
      season: 3,
      lat: 33.5066,
      lng: 126.4912,
      bait: "게",
      method: "뜰채",
    },
    {
      fishId: 5,
      fishName: "광어",
      place: "제주시 용담2동",
      size: 50,
      fishImg:
        "data:image/jpeg;base64,",
      createAt: "2025-06-10T13:10",
      season: 2,
      lat: 33.507,
      lng: 126.4915,
      bait: "지렁이",
      method: "맨손",
    },
  ];

  // [임시] 추후 삭제 예정
  function getMockRecordById(id: number) {
    return dataMap.find((item) => item.fishId === id);
  }

  const data = getMockRecordById(fishId);
  console.log("data", data);

  const [status, setStatus] = useState<"AM" | "PM">("AM");

  const [time, setTime] = useState("");

  useEffect(() => {
    if (!data) return;

    const hour = Number(data.createAt.slice(11, 13));
    const minute = data.createAt.slice(14, 16);

    if (hour >= 12) {
      setStatus("PM");
      setTime(`${hour === 12 ? 12 : hour - 12}:${minute}`);
    } else {
      setStatus("AM");
      setTime(`${hour}:${minute}`);
    }
  }, [data]);

  return (
    <SafeAreaView>
      {/* 헤더 */}
      <Header logo={false} title={title} before={true} />

      <ScrollView contentContainerStyle={{ flexGrow: 1, paddingBottom: 52 }}>
        {data && (
          <View className="mx-5 gap-5">
            {/* 사진 */}
            <Image
              source={{ uri: data.fishImg }}
              className="w-full h-[250px] rounded-xl"
            />

            {/* 물고기 정보 */}
            <View className="gap-3">
              <Text className="text-neutral-800 font-semibold">
                물고기 정보
              </Text>
              <View className="flex-row gap-1">
                <SelectButton
                  name={data.fishName}
                  fill={true}
                  onPress={() => {}}
                />
                <SelectButton
                  name={`${data.size}cm`}
                  fill={false}
                  onPress={() => {}}
                />
              </View>
            </View>

            {/* 환경 정보 */}
            <View className="gap-3">
              <Text className="text-neutral-800 font-semibold">환경 정보</Text>
              <View className="p-5 border border-neutral-200 rounded-xl gap-1">
                <Text className="text-neutral-400 text-sm">
                  시간{"  "}
                  {status} {time.replace(":", "시")}분
                </Text>
                <Text className="text-neutral-400 text-sm">
                  위치{"  "}
                  {data.place}
                </Text>
                <Text className="text-neutral-400 text-sm">
                  물때{"  "}
                  {data.season}물 (서해 {data.season - 1}물)
                </Text>
              </View>
            </View>

            {/* 위치 정보 */}
            <View className="gap-3">
              <Text className="text-neutral-800 font-semibold">위치 정보</Text>
              <View className="p-5 flex-row items-center border border-neutral-200 rounded-xl gap-5">
                {/* 지도 */}
                <View className="w-32 h-24 rounded-xl overflow-hidden">
                  <MapView
                    style={{ width: "100%", height: "100%" }}
                    region={{
                      latitude: data.lat,
                      longitude: data.lng,
                      latitudeDelta: 1,
                      longitudeDelta: 1,
                    }}
                    pointerEvents="none"
                    scrollEnabled={false}
                    zoomEnabled={false}
                  >
                    <Marker
                      coordinate={{ latitude: data.lat, longitude: data.lng }}
                    />
                  </MapView>
                </View>

                {/* 장소 정보 */}
                <View className="gap-1">
                  <Text className="text-neutral-400 text-sm">
                    위치{"  "}
                    {data.place}
                  </Text>
                  <Text className="text-neutral-400 text-sm">
                    위도{"  "}
                    {data.lat.toFixed(4)}
                  </Text>
                  <Text className="text-neutral-400 text-sm">
                    경도{"  "}
                    {data.lng.toFixed(4)}
                  </Text>
                </View>
              </View>
            </View>

            {/* 미끼 정보 */}
            <View className="gap-3">
              <Text className="text-neutral-800 font-semibold">미끼 정보</Text>
              <View className="flex-row gap-2">
                {(["지렁이", "새우", "게", "루어"] as const).map((bait) => (
                  <SelectButton
                    key={bait}
                    name={bait}
                    fill={data.bait === bait}
                    onPress={() => {}}
                  />
                ))}
              </View>
            </View>

            {/* 낚시 정보 */}
            <View className="gap-3">
              <Text className="text-neutral-800 font-semibold">낚시 정보</Text>
              <View className="flex-row gap-2">
                {(["낚싯대", "맨손", "뜰채"] as const).map((method) => (
                  <SelectButton
                    key={method}
                    name={method}
                    fill={data.method === method}
                    onPress={() => {}}
                  />
                ))}
              </View>
            </View>
          </View>
        )}
      </ScrollView>
    </SafeAreaView>
  );
}
